import axios from 'axios'
import { 
    GET_POSTS, 
    GET_INFO, 
    GET_CATEGORIAS, 
    GET_MEDIATYPE, 
    GET_MEDIAURL, 
    RESET_MEDIA, 
    NEW_USER_CREATE, 
    LOG_IN, LOG_OUT, 
    NEXT_VISOR, 
    RESET_VISOR, 
    LOGGED_ACCOUNT, 
    GET_USERS, 
    OPTION, 
    RESET_OPTION} from '../../misc'

/*-----------------Auth----------------*/
export function setOption(e){
    return({
        type: OPTION,
        payload: e
    })
}
export function resetOption(){
    return({
        type: RESET_OPTION,
    })
}

export function getUsers(){
    return async function (dispatch){ 
        await axios.get('http://localhost:10000/users')
        .then(res => {
            dispatch({
                type: GET_USERS,
                payload: res.data
            })
        })
        .catch((e) => {
            console.log(e)
        })
    }
}

export function newUserCreate(newUser){
    return async function (dispatch){
    await axios.post('http://localhost:10000/users/create', newUser)
    .then(res => {
        dispatch({
            type: NEW_USER_CREATE,
            payload: res.data,
        })
    })
    .catch(error => {
        return { payload: error };
    })}
}

export function getLoggedAccount(pathname){
    return async function (dispatch){ 
        await axios.get('http://localhost:10000/users/loggedaccount')
        .then(res => {
            dispatch({
                type: LOGGED_ACCOUNT,
                payload: res.data,
                pathname: pathname
            })
        })
        .catch((e) => {
            console.log(e);
        })
    }
}

export function logIn(input){
    return async function (dispatch){ 
        await axios.post('http://localhost:10000/users/login',input)
        .then(res => {
            dispatch({
                type: LOG_IN,
                payload: res.data
            })
        })
        .catch((e) => {
            console.log(e);
        })
    }
}

export function logOut(userName){
    return async function (dispatch){ 
        await axios.post('http://localhost:10000/users/logout',userName)
        .then(res => {
            dispatch({
                type: LOG_OUT,
                payload: res.data
            });
        })
        .catch((e) => {
            console.log(e);
        })
    }
}

/*----------------Posts----------------*/
export function getPosts() {
    return async function(dispatch) {
        await axios.get('http://localhost:10000/posts')
        .then(res =>{
            dispatch({
                type: GET_POSTS,
                payload: res.data
            })
        })
        .catch(e => console.log(e))
    }
}

export function getInfo(id) {
    return async function(dispatch) {
        await axios.get(`http://localhost:10000/posts/${id}`)
        .then(res =>{
            dispatch({
                type: GET_INFO,
                payload: res.data
            })
        })
        .catch(e => console.log(e))
    }
}

export function getCategorias(lista) {
    const listCat = []
    lista.map((e)=>{return e.categoria.map(el=>{return listCat.push(el)})})
    return {
        type: GET_CATEGORIAS,
        payload: new Set(listCat)
    }
}

export function getMediaType(mediainfo) {
    return {
        type: GET_MEDIATYPE,
        payload: mediainfo
    }
}

export function getMediaUrl(mediainfo) {
    return {
        type: GET_MEDIAURL,
        payload: mediainfo
    }
}

export function resetMedia() {
    return {
        type: RESET_MEDIA,
        payload: []
    }
}

export function getNextVisor(index){
    return {
        type: NEXT_VISOR,
        payload: index
    }
}

export function getResetVisor(){
    return {
        type: RESET_VISOR
    }
}
/*------------Filter&Search------------*/
export function loadingSearchSet(){

}

export function searchMedia(){

}

export function searchStateChange(){

}

export function totalMedia(){
    
}


/*--------------Pagination-------------*/
